    }
 componentDidMount() {
  fetch('https://www.reddit.com/r/nonbinary.json')
 .then(Listing => { if (!Listing.ok)
  { throw Error("Network request failed") }
  return Listing;
 })
 .then(data => data.json())
 .then(data =>
  this.setState({Listing: data
   }))
}

f_test(){
    
    const testData = this.state.Listing['data'];
    const testDataString = JSON.stringify(testData);
