}
 render() {

    if (!this.state.results)  this.f_test()
    if (this.state.requestFailed) return <p>Failed!</p>
    if (!this.state.results) return <div>{
        JSON.stringify(this.state.Listing['data'])}</div>;
 }
}
 export default FetchConnectApi;
